import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4.93 4.37A3.82 3.82 0 018 3c.85 0 1.84.28 2.63.93a3.73 3.73 0 011.35 2.6c.69.08 1.35.34 1.89.75A2.77 2.77 0 0115 9.5c0 .88-.3 1.65-.92 2.2-.62.54-1.5.8-2.58.8h-7c-1.35 0-2.26-.41-2.81-1.05A2.95 2.95 0 011 9.5c0-1.18.97-2.77 3.03-2.98.08-.72.37-1.5.9-2.15z", fill: primaryFill }));
};
const Cloud16Filled = wrapIcon(rawSvg({}), 'Cloud16Filled');
export default Cloud16Filled;
